import React from 'react';
import Page from '../Page';
import Login from '../Login';
class LoginPage extends React.Component{
    render(){
        const _content = [];
        _content.push(
            <Login></Login>
        );
        return (
        <div>
            <Page content={_content}></Page>
        </div>
        );
    }
}

export default LoginPage;
